import React, { Component } from 'react';

class App extends Component{

    constructor(){
        super();
        this.state = {displayBio : true};
    }

    render(){
        const bio = this.state.displayBio ? (
            <div>
                <p> I am persuing Btechf rom MIET, Meerut</p>
                <p> I done a remote internship from internity in java. they gave 
                    me many challenges on which i stood upon.
                </p>
            </div>
        ) :  null;
        return(
            <div>
                <h1>Aditi Gupta</h1>
                <p>My name is Aditi Gupta. I am a jr. associate IT.</p>
                <button onClick = {this.onRead()}>REad More</button>
                {bio}
            </div>
        )
    }
}
export default App;
